std::string markdown2html(std::string const& content, markdown_iterator_tag<std::string> it)
{
    using qi = qi::grammar<markdown_iterator_tag<std::string>>;
    using qi::char_;
    using qi::string_;
    using qi::symbol_;

    auto doc = qi::phrase("[H2]")
        | markdown2html(content, it)
        | symbol_(r'\n')
        | symbol_(r'\r')
        | symbol_(r'\t');

    auto pdoc = qi::phrase("[H3]")
        | markdown2html(content, it)
        | symbol_(r'\n')
        | symbol_(r'\r')
        | symbol_(r'\t');

    auto paragraph = qi::phrase("[P]")
        | symbol_(char_)
        | symbol_(char_)
        | pdoc;

    return paragraph.toString();
}

